INSERT INTO `catalog_comment` VALUES (2659,199,'I love ipower. They offer protection for my web site and a seal that offers the web site a sense of trust for it\'s users. They are easy to use, as I have my own account with them, and they email me information and updates to my email address. Their cusotmer service is very good as when I started up my web site, I didn\'t know how to work it, and they helped me by walking me through it.Oh also, I can go online and have control over my account also. My buddy also does web design, and he recommened me to them.','2009-01-16 00:37:16','Jon','mt@mt.com','http://www.dweetir.com/',-1,'12.217.117.143'),(2679,198,'According to me Godaddy provides the best hosting plans and provides much more then just hosting. The Hosting plan provides you a domain name and lots and lots of features. Godaddy provides top class security, great back up and excellent servers. The hosting plan also provides you with the statistics feature using which i can monitor the performance of my website. The customer support is just incredible and support representative can be contacted by email or phone at all times. For me godaddy provides the best hosting plans. ','2009-01-16 00:37:16','Ashish','ashish.india7@gmail.com','',1,'59.94.208.129'),(2660,197,' I used Yahoo to build and host my website and it turned out great! I used their site building program, Yahoo Site Builder, and people could not believe that I actually did it myself! I had several pages, many buttons and a lot of pictures and videos. Their customer service folks always helped me with anything I needed. All in all, it was a great service!','2009-01-16 00:37:16','Patrick','mt@mt.com','',1,'12.217.117.143'),(2661,1,'The price is the best part of Blue Host. I am considering switching though. All websites need to have Frontgage extensions. If you do not like Frontpage, chose another host. They are not very fast at fixing problems either. Expect a 1-2 day wait, at least. Customer service is moderately helpful. Do not be fooled by the number of websites that they host. They have been around a relatively long time, and people are just reluctant to switch. I have experience with several hosting companies and Blue Host is the worst ever for ease of use. I would switch, but I handle clients websites and cannot change them to a new host yet. Uptime is average, not exceptional.','2009-01-16 00:37:16','Lesley','mt@mt.com','',1,'12.217.117.143'),(2662,198,'We are previous customers of GoDaddy. They also registered our domain site for us. We were happy with the customer service that they provided. When we had questions, or needed to make changes with them to our hosting, we always had excellent customer service. Their customer service was very knowledgeable. You cannot say that about most companies. GoDaddy has low competitive rates for hosting a domain site on their servers. The only negative I could find with them is that it was difficult to understand their navigation in the \"your account\" area. We would use their service again.','2009-01-16 00:37:16','Laura','mt@mt.com','',1,'12.217.117.143'),(2663,200,' I\'ve tried many host providers over the last few years. I have had a few bad experiences, including bad customer service and places that continued to bill me after the account was closed. Fortunately, the last site I tried was Host Gator. They have very fair rates, quality customer service representatives, and deliver on what they promise. I highly recommend them to someone who is starting their first website, as well as experienced people. They take the time to fully answer your questions and the access and controls for your site are easy to understand.','2009-01-16 00:37:16','David','mt@mt.com','',1,'12.217.117.143'),(2664,198,' I had bought the economy plan for this website of my old college last year. It cost me around 60 USD. The best advantage it offered was a domain name for only 3 USD for 1 year!. The overall experience with the GoDaddy was good in terms of fast processing. Initially I was not able to manage my domain somehow due to some error. In just 4 hours they changed their server settings and made sure my site was online again. The uptime I feel is around 99% and more. Technically their customer support is very knowledgeable and so they can solve your probs quite in detail. One of my technology friends had his company site on it which uses SSL and database which worked flawlessly. However, since I was on a tight budget, later I went on for a cheaper webhosting provider. Now it is on www.net4.in which gave me local India hosting, which may not be as fast as Godaddy but was cheap at 12 USD/annum for 50MB space. However, I do miss GoDaddy\'s features, ease and quality. But hey its much difference in price. but if you want a webhosting provider with more space and features, Godaddy is for you. I would also recommend use of BlueHost. However, me and my colleagues experience would discourage use of Yahoo! and Lunarpages. Hope I would have been of help..','2009-01-16 00:37:16','Saurabh Vyas','mt@mt.com','http://www.mpsmcortho.org.in/',1,'12.217.117.143'),(2665,198,'I have hosted approximately 5 websites with godaddy.com. I have found their site to be very user friendly. I did need some help at first because some of the terminology was new to me. I called their customer service and received excellent and fast help. I have regretted using other hosts. I will always use godaddy.com for future websites. The price is so low I cannot even believe it. It is even lower if you combine services. I give godaddy.com a big thumbs up.','2009-01-16 00:37:16','Angie','mt@mt.com','',1,'12.217.117.143'),(2666,205,'I thought fatcow was a pretty decent web host. I used them for 1 year then moved on though due to price issues. My website didn\'t have any downtime or serious issues for the most part which was really good. One thing that is good for people who are new to websites and hosting is the fact that you get so many \"pre-made\" options, the google webmaster tools are great, and their online store works pretty well... I would recomment them to others.','2009-01-16 00:37:16','Brad','mt@mt.com','',-1,'12.217.117.143'),(2667,194,'My website was having big issues with my old server, and I chose JustHost based on a friend\'s advice. JustHost got it moved within 2 days with a super smooth transition. The things that were very important to me in a server were: unlimited bandwith ,as close to 100% uptime as possible,and great customer service. JustHost guarantees 99.9% uptime and they have completely delivered. I have the unlimited bandwith package. Customer service is fantastic, they are there 24/7 and very responsive. One more great thing about JustHost: the control panel! It\'s so simple that it\'s actually a pleasure to use.','2009-01-16 00:37:16','Jennifer','mt@mt.com','',1,'12.217.117.143'),(2668,197,'I have used Yahoo as a webhost for my company for many months now and have found it to be outstanding. Yahoo\'s web design software allowed me to creat my own professional looking webpage without having to know any html or anything like that. I love how user friendly it is. I have never had a problem with my site going down and Yahoo\'s customer service has been unmatchable. I would refer my family and friends to yahoo without a second thought!','2009-01-16 00:37:16','Candice','mt@mt.com','',1,'12.217.117.143'),(2669,197,'Last business I owned with my business partner dealt with motorcycle parts. We decided to get more customers if we target a wide scope area instead of just locals. We tried to hire a private company to design and host the webpage for us but, that cost too much. Finally we decided to go for Yahoo hosting. The price was cheap and we really didn\'t need all the flash and graphs as seen on some of the fancy pages. We wanted customers to know what we carried, the retail price and what are the functions of these parts. With simple navagating and easy browsing we were able to create a pretty decent page. I like working with yahoo in two areas. 1. The price is reasonable 2. It carries all the needed templates for you to create a decent webpage.','2009-01-16 00:37:16','Charles','mt@mt.com','',-1,'12.217.117.143'),(2670,198,'I have used GoDaddy to host three of my sites and have found them to be an excellent web hosting service.  I talk to their customer service department on a regular basis and the calls are answered quickly by people who know how to treat customers and address inquiries.  My experience with the site is that it is very easy to register a domain name, the price is fair, and the technology has been reliable in my experience.  I have not experienced any major downtime that impacted my sites, and the speed is pretty good, even for sites with lots of graphics.','2009-01-16 00:37:16','Diego','chicagopj99@yahoo.com','',1,'76.212.133.170'),(2720,1,'The Bluehost pricing may be why I chose Bluehost as my host, but what you pay is what you get with this one. In my experience most of my support issues have taken at least 3-4 days to even get a response, and another 1-2 to get the issue resolved. Their uptime is just plain awful, and they have outages a lot. But Bluehost does have some fantastic features such as the live chat, and the file manager, the scripts are also good and more up to date than other hosts I have tried.\r\n\r\nOverall, I consider bluehost average. The features are a little above average (B-) I would say, but support and uptime are definitely a D. In my opinion Bluehost is \"spotty\" and will be great for a week, and bad for another. Same with service, great one time, awful the next. As I stated earlier, bluehost is just average, if you can afford a little more, go somewhere else.','2009-01-19 22:22:42','Ben Baker','benbaker@iusb.edu','',1,'173.46.227.182'),(2672,1,'Bluehost offers reliable hosting, with all the features you\'d expect, for a reasonable price.  The cPanel interface is intuitive, and allows for easy configuration of many options.  Bluehost also offers secure shell access for Linux hosting.  However, as with most shared hosting, installing software can be a pain.  Installing libraries or modules for programming languages is somewhat inconvenient, but it can be done.  Creating new databases & users is also somewhat annoying.\r\n\r\nUptime is very good, and the support folks are pretty responsive.','2009-01-16 00:37:16','Ravi V','csmm1999@yahoo.com','',1,'24.16.74.182'),(2673,200,'After many days of research, Host Gator is the hosting company we finally selected to host the website of a motorcycle club that my husband belongs to.  It was my intention to design the site and transfer it to Host Gator, but the templates they provided were wonderful, and I ended up using those to produce a nice looking website.  They didn’t look sub-par at all.  There was never any downtime, and responses to questions were quick and thorough.  I had some very basic beginner questions, and they answered them with a professional, clear explanation.  They were never condescending or rude.  The price was competitive; not necessarily the cheapest, but “you get what you pay for”.  We also chose Host Gator because I didn’t want to host with the same company that I purchased my domain name from (I’ve heard horror stories about moving domain names after the hosting has stopped at other companies).  Overall, I’m satisfied with Host Gator and will continue to use them for future needs.','2009-01-16 00:37:16','Teri Tangerman','Teriturk@gmail.com','',-1,'67.174.143.251'),(2674,198,'GoDaddy is the best website for hosting a personal webpage or a small website. GoDaddy hosting plans includes website statistics tools that help me review the performance of my webpage. GoDaddy customer care service is excellent. The response to the user queries is very fast. It helps the beginners like me to easily set up their site including advanced features by paying a reasonable fee. For the professionals GoDaddy is the best hosting site.','2009-01-16 00:37:16','Khushi','erkhushi12@yahoo.co.in','',1,'117.197.168.76'),(2675,197,'I have recently been trying to make my own website. After sifting through many hosts, I finally decided that I wanted to use Yahoo. I had a great experience! The features were all explained throughly and were simple and easy to use. When I did happen to run into something I didn\'t know how to do, Yahoo\'s customer support was there for me. Not to mention their prices are so fair! Overall, I really enjoyed using Yahoo\'s hosting services. ','2009-01-16 00:37:16','Xombicide','chilvary-killed-romeo@hotmail.com','',1,'67.163.174.101'),(2676,1,'Bluehost provides very good hosting plans that come with all features required for starting a website; the various features include cPanel, multiple database support, FTP, email and many more. The best feature that is provided by Bluehost is unlimited disk space and bandwidth. The cPanel is very easy to use, as a starter I was able to work with little problems. The support from the bluehost team is also great; I use to contact them through their toll free service number and was always helped out. All in all it is a good hosting provider with good all round features.','2009-01-16 00:37:16','Sanja','mt@mt.com','',1,'12.217.117.143'),(2677,206,'Webhostingpad boasts all of the features any person would need to easily start and maintain a website. Via a web-based graphical interface users can upload and manage files, install various preconfigured applications (blogs, messages boards, image galleries, etc.), setup email accounts, setup sub-domains, and handle SQL databases. The response time on this web-based control panel is much faster than ones offered by other web hosts I have tried in the past. Another nice feature is the ability to mass-upload files via FTP. FTP accounts are setup via the control panel as well. Lastly the price point is very competitive.','2009-01-16 00:37:16','Jer','mt@mt.com','',-1,'12.217.117.143'),(2678,203,'In the past I have used StartLogic for web hosting. I only briefly needed to use a hosting site but for the few months that I used the service I was extremely pleased with the service. I used the \"personal logic\" plan which featured 60 GB of storage, easy site building tools and some other great features for photos galleries. This is the only hosting site that I\'ve used, so my overall experience is limited but I recognized the quality and would recommend the option to anyone.','2009-01-16 00:37:16','William','mt@mt.com','',-1,'12.217.117.143'),(2680,198,'This was my first experience with GoDaddy, and just like the comercials that you may have seen for it the site gets people there!  I never had any problems with the site (and I do not know a ton about techy stuff).  At first it was a little difficult for me to navigate how to set everything up but compared to other sites that I have looked at GoDaddy is very simplified.  I would definitly tell you to check it out...and it is very competitive in pricing','2009-01-16 00:37:16','Emily Ickes','emmyicks248713@yahoo.com','',1,'131.187.254.8'),(2682,199,'IPOWER was all in all a decent web hosting company. The uptime was fantastic, never had an issue with my site being down. However, their customer support was very limited in my case. I asked for help with some FTP issues (on their end), and their support system took over 48 hours to get back with me, compared to a mere couple of hours with an alternate hosting provider. That was really the only issue I had with them, however. I also used them to register domains through, which was a pleasant experience as well.','2009-01-16 00:37:16','Jordan','sinnastarr@mail.com','',1,'75.149.91.241'),(2683,198,'I have a host at GoDaddy. I bought it when there was a promotion and the price I remember it is around 6 dollars for a deluxe plan. I think it is a fair price, though it is a little bit higher than some other hosting. But considering the stability and features of GoDaddy, I regard this as a pretty good investment for the website of my small business. I am still using this host and it runs good. In my memory there was just one downtime during the past 6 months when there was a maintenance or something but it did not really influence me. I ever wrote to a customer services representative about the upgrade of the plan and I received the positive response in a really short time. I am satisfied with GoDaddy.','2009-01-16 00:37:16','Mike Li','icetallica@gmail.com','',-1,'24.184.170.34'),(2684,198,'Everyone knows that GoDaddy has been around for years, and I\'ll tell you why.  It\'s because they have excellenet services and unlike some of my previous hosts, GoDaddy stands behind their services and delivers near perfect service.  I never had any issues with my GoDaddy hosted site.  The prices are outrageously low as well.  And Support Team is actually helpful as opposed to all the other hosts I\'ve used.\r\n\r\nThanks to the GoDaddy Team.','2009-01-16 00:37:16','Adovir','queso@indiatimes.com','',1,'76.185.242.239'),(2685,198,' I signed recently to Godaddy because my other webhosting company (Parcom) began to have to much problems send me many white pages \"Service Unavailable\" since my site began to have mor visits (200 a day). And Godaddy is even better since it is cheaper and have frequent campaigns of discounts. So I signed with them for 3 months just for 4.99$ month and the service is much better: I never have any more the \"Service Unavailable\" issue again. I\'m with them last 3 months and I\'m really happy with the change: They are cheaper, always on, with a wonderful support service, payment by paypal, and all the features you can imagine.','2009-01-16 00:37:16','Luis','mt@mt.com','',-1,'12.217.117.143'),(2686,198,'I had set up a website for an organization I\'m a member of, but we decided to cancel shortly after. GoDaddy provided an extremely easy to utilize web builder and their billing and set-up fees were reasonable and straight forward. When we decided to cancel, I had to call in to their customer support center. The person that answered the phone was courteous and handled my issues promptly and without any hassle. I would recommend and use GoDaddy again if I needed an easy to use website builder and hosting service.','2009-01-16 00:37:16','Justin','mt@mt.com','',1,'12.217.117.143'),(2687,197,'I\'ve used Yahoo hosting for a year and I must admit that I didn\'t like it that much. The main problem was that my PHP pages weren\'t working as they were supposed to because of the outdated PHP installed. However, for a beginner, Yahoo hosting might be a good choice since it offers good price and SiteBuilder which makes creation of pages easier. I must also give my best recommendation for their support service. They were rather fast and helpful in answering all my questions (and there were many of them).','2009-01-16 00:37:16','kristijan','satarazh@yahoo.com','',-1,'78.1.165.66'),(2688,198,'Absolutely terrible. Firstly, they have crap support. You\'ll be transfered to somewhere in India, where the person won\'t know how to solve your problem, etc...\r\n\r\nSecond, the web design application is very unintuitive. You\'re unable to customize the HTML, and there are far superior free utilities out there, such as Google Sites. You would  be much better off with some GeoCities page than GoDaddy.\r\n\r\nFinally, they have a bad track record. Google \"godaddy issues\" for the horror stories of people who\'ve had their domain stolen and worse. ','2009-01-16 00:37:16','luke','hostchoice.ffman@xoxy.net','',-1,'71.246.233.68'),(2699,204,'We hosted one of our sites with IX Web Hosting over 12 months this past year. What’s good about them? They’re cheap and offer just about all you’ll need. When you run into problems, they’re a nightmare. Most of our problems were performance related. We were running ASP.NET (which is slow) but obviously they had so many virtual hosts on the hardware that it wasn’t useable. Connecting to the SQL server, more often than not, timed out. The worst part was their tech support (useless) blamed us for the problems. We were running the same code on DiscountASP.net without a hitch.  It really wasn’t worth our bother to save a few dollars. At $6/month, you get what you pay for. Spend a little extra and save yourself the headaches.','2009-01-17 16:32:01','Brent','bjd65ct@yahoo.com','',1,'69.37.154.176'),(2690,197,'hi.i am sabarish.when i started my website 3years back,i searched for web hosters and found tahoo to be the best one.it comes with a site building tool to develop your site.the tool has various facilities.i had many pages and attractive images in my site.no one could believe that i only created that website.the tool is simple and easy to use.\r\nno need to know html or any other programming language.it will support u to develop your style of website.Their customer service is little slow i think and cost is comparitively reasonable for a good service.i last used it a year back and i hope more features will be available now.my first choice for my buddies would be yahoo hosting.','2009-01-16 00:37:16','sabaedge','sabaedge@gmail.com','',1,'117.201.18.27'),(2691,198,'I\'ve used GoDaddy for my website hosting needs and domain registration for several years now, and every year I tell myself I\'m going to switch to another host, but I don\'t because it\'s just such a pain in the butt. Their servers are sluggish, their http administrator interface is confusing, and their customer service is not very high quality either. The worst part is however that their shared hosting servers in my experience can\'t handle even a medium volume of traffic without slowing down pageviews dramatically. I\'ve gotten on social networking sites like Digg and Reddit numerous times and GoDaddy\'s servers just don\'t do the job (and there\'s nothing worse than knowing tons of people want to read your website but they can\'t!).','2009-01-16 00:37:16','Bobby','littleknownfactstv@gmail.com','',-1,'71.235.188.102'),(2692,194,'Justhost web hosting is reliable due to the fact that they provide load balancing technology and fast backbone connections. They provide a lot of features that include unlimited disk space, unlimited bandwidth, unlimited email accounts and unlimited domains. They also offer a NO QUESTION ASKED money back guarantee within 30 days of sign up. They provide a very good uptime and great customer support. The cPanel provided by just host is very easy to use and work with. I will say a value for money hosting provider. ','2009-01-16 00:37:16','Ashish','ashish.india7@gmail.com','',1,'59.94.180.115'),(2693,202,'I switched to Lunarpages after having a lot of downtime and problems with another hosting company. I host multiple site that receive moderate to small traffic and lunar pages has been perfect. Excellent value for the money. I had one problem and called customer service and got an immediate response and my problem was fixed within 10 minutes. I haven\'t noticed any downtime or drag yet. ','2009-01-16 00:37:16','J Brown','brjill@msn.com','',1,'70.190.139.229'),(2694,197,'I used Yahoo for hosting before I switched to Godaddy finally. What I would like to say about Yahoo is its price. The promotion for the first year is relatively affordable considering it is a big name. But in the following year they are going to increase the charge by times. Another thing I do not like Yahoo is their services. I ever wrote to the customer services and never got a response before I shot another email to bother them again. The uptime and storage are OK with Yahoo. ','2009-01-16 00:37:16','Mike Li','icetallica@gmail.com','',-1,'24.184.170.34'),(2695,1,'Bluehost provides a great web hosting services for beginning a website. It provides excellent features of web host such as cPanel, FTP, email accounts etc just for a reasonable price. It provides unlimited bandwidth and disk space. There are a number of addon domains and sub domains provided by Bluehost. The scripts provided by the Bluehost are all latest and up to date. Bluehost team provides good customer services and responses to the queries. On the whole Bluehost is a good web host.','2009-01-16 00:37:16','Khushi','erkhushi12@yahoo.co.in','',1,'117.197.167.247'),(2696,200,'I used host gator for a word press personal blog site and as a hosting company they were good. However, when I wanted to cancel my service, they have no link on their website to cancel your account. I sent them an email and asked them to cancel my account and never got a response. I tried phoning and couldn’t talk to someone. I tried to use their “online chat”, but they told me that I can’t cancel my account that way. On my next billing cycle there was a charge on my credit card and I phoned to complain. They told me that they hadn’t received my email and that even if they had, you can’t cancel by email. I forwarded them the email I had sent them the previous month and asked for the charge to be reversed – which they never did. Anyways, for $10 I didn’t end up perusing it any further as it isn’t worth my time, but I wasn’t impressed with their customer service. I would probably use them again, but I wish they made it intuitive to cancel your account when you no longer want it.','2009-01-16 00:37:16','Mike','zedsun@hotmail.com','',-1,'24.129.58.183'),(2697,197,'I found Yahoo! to be a very poor choice for shared hosting. It seemed that at least twice a month, I would get MySQL connect errors, or very slow performance for dynamic pages that used a database. Support requests were only honored to an @yahoo.com address despite requests that it be sent to the email at the domain I had with them. \r\nIn addition, Yahoo! really packs its servers. I found out at one point that over 200 sites were on the same server as me. They also don\'t support basic functionality, probably as a result of packing the servers. You can\'t make a .htaccess file, for example. Setting up new users for FTP is a pain in the ass, and you can\'t use FTP over SSL. All in all, no matter how good the price seems, Yahoo! is a very, very poor quality shared host.','2009-01-16 00:37:16','Neito','neito@nerdramblingz.com','',1,'72.70.18.242'),(2698,194,'With unmetered web space, unmetered email, unmetered bandwidth, 99.8% up and running with many more unbeatable features, Justhost is sure on top of the chart. You can\'t beat customer care services. And the price, it fits every budget. If you think of switching host, it has never easier doing it with them. They will guide you every step of it. Money back absolutely guaranteed. You are always better off with Justhost. Go get it.','2009-01-16 00:37:16','Prince','pasignature@yahoo.com','',-1,'62.173.34.44'),(2700,205,'For small to medium-sized businesses and individuals looking for an affordable web hosting option, this company rocks! Tons of supported technologies and though they went down once while I had them, it was only for a minute or so. I can\'t really say much for how well the features worked in practice because I am a pretty basic user, but everything seemed alright. My biggest issue with them was the load time. During peak bandwidth usage, it could take several seconds more for my page to load. \r\nThe thing this company does right is customer service. I actually used Zencart (great shopping cart software) and I was having trouble. I talked to them and even though it wasn\'t their responsibility or product, they guided me through it. FatCow\'s control panel is a little hard to read and navigate because it isn\'t intuitively organized, but it gets the job done.\r\n','2009-01-17 16:32:01','Luke','lkarmaz2@gmail.com','',1,'209.107.236.186'),(2701,198,'I\'ve used GoDaddy for a little over 2 years and have been quite happy with the service. I\'ve only had to use support a couple of times but each time was relatively brief and painless. Getting setup for the first time could be a little easier. Hopefully they have added some further documentation since I first enrolled. Uptime has been fine - obviously 100% would be ideal, but compared to the horror stories I\'ve heard and witnessed amongst my peers, I\'m content. I do not plan to change providers anytime soon.','2009-01-17 16:32:01','AdamB','abooth413@yahoo.com','',1,'72.193.233.200'),(2702,194,'Unlimited Storage and Transfer is a must have these days with any provider. JustHost provides both at a great rate. Customer Service is available 24/7 and is very helpful. I did end up switching service after a while though due to other reasons. But I would recommend JustHost to anyone especially considering they have a 30 day money back guarantee. They also guarantee a 99.9% uptime and will pay for a months service if they don\'t meet that standard!','2009-01-17 16:32:01','MikeZ','mikeyz16@aol.com','',1,'72.193.233.200'),(2703,203,'I have used Startlogic for almost a year now since switching from another (Poor!) provider. I host several domains under my account and I couldn’t be happier. The host has been UP for me 100 percent of the time. I have had no problems at all. The control panel is fast, easy to use, and intuitive and I am very pleased with the service in general. You can’t go wrong for the price, and quite frankly I feel like I get WAY more than I pay for. I highly recommend Startlogic to anyone looking for a hosting service','2009-01-17 22:54:38','Tom Ray','alabamatom69@gmail.com','',1,'68.63.65.125'),(2704,197,'If you\'re just starting and want a simple web host without too many confusing options, then Yahoo Web host is for you, since it\'ll help you to create a site with it\'s tools, but don\'t try to use more advanced features because it\'s probably not going to support them.\r\n\r\nI like to handle everything in my site, and I found out that I couldn\'t make an .htcaccessfile so there would be no custom error or some other stuff that I like to use. \r\n\r\nSo, if you\'re and advanced webmaster, you\'ll be better looking for some other webhost, since yahoo will most probably be too basic for you.','2009-01-18 00:18:44','Wilsonx1999','wilsonx1999@gmail.com','',-1,'189.154.47.106'),(2705,204,'I have hosted my site with IX Web Hosting for several years now and have had a positive experience.  I run a fairly simple site that does not require many features so the service has been perfect for me.  It is extremely inexpensive and I have experienced no major issues with the site being down.  I have contacted their support team a few times over the years and the responses have always been quick and effective.  IX Web Hosting has suited my needs very well. ','2009-01-18 00:18:44','Steven C.','schwehm@gmail.com','',1,'76.181.64.135'),(2706,192,'Overall- I\'ve found HostMonster\'s services to be adequate, though a bit quirky at times.  I had some issues with php form generated e-mail being bounced out of my account, and never did get to the bottom of that.  For the cost, it\'s not a bad host, and has a myriad assortment of configurable options to suit most users need.  However, their online GUI for feature access leaves something to be desired with regard to its organization and usability. ','2009-01-18 00:18:44','jhammer','philaphile@gmail.com','',-1,'76.124.71.83'),(2707,197,'I like \"Yahoo\" web host because it has a lot of very useful features that will really help the user in doing things that they wanted to do. One of the features that I like the most in \"Yahoo\" is their built in tools for making a website. Aside from that, \"Yahoo\" is already a known, proven and tested web hosting choice of a lot of user that is why anyone that will use \"Yahoo\" will have an assurance that it is safe and really dependable and of good quality. The only thing that I do not like with \"Yahoo.\" is their pricing system or process. It keeps on increasing without a proper notification to its user why they are increasing its price.','2009-01-18 00:18:44','Jimdavis','jim_ravidas@yahoo.com','http://www.1explore.com/',1,'122.144.64.58'),(2708,194,'There are very few hosts which have the outstanding customer service that JustHost provides.  There customer service representatives are available all day every day which can be a big help when your in a bind. One thing which I didn\'t like was the price. They advertise one price (5.95) but then try to sell you on a bunch of other packages which can dramatically increase your monthly bill. Overall I would recommend JustHost but be aware of any overages your may experience.','2009-01-18 00:18:44','Enoredlac','rickcalderone@gmail.com','',1,'216.80.45.219'),(2709,202,'I have previously hosted two sites on Lunarpages and was generally satisfied with their feature set and support structures. Certainly one of the better cheap hosts and a great starting point for the cash-strapped developer in need of cheap hosting. Would recommend for small to medium websites.','2009-01-18 00:18:44','R Felix','mandraketas@yahoo.com.au','',1,'59.102.14.116'),(2710,197,'I\'ve used Yahoo hosting for multiple smaller domains I have had in the past. They are an excellent choice especially for those new to the world of creating websites easily. The Sitebuilder tool is nice - but limited in some aspects. The support is very good and answers to your queries are responded to quickly. Another nice function with Yahoo is that you can tie into their merchant functionality and actually sell your products online through their programs and listing service.','2009-01-18 00:18:44','Nan Shastry','intellipodcast@gmail.com','http://www.intellipodcast.com/',-1,'74.87.153.34'),(2711,1,'Price for hosting is the best part of BlueHost. It is really very cheap as compared to others. It has many interesting features. I like the live chat feature the most. But sometimes it becomes too slow that I have to close it. The server sometimes becomes too slow to tolerate. For people who do not do business with this host is alright.I use this host for my money making offers blog. But I would not like to recommend BlueHost for business purpose. Otherwise most of the time your business will be down. The worst part is that they promise to give you unlimited bandwidth and a large storage. But it is not true. At a certain level you will definitely face this problem.','2009-01-18 00:18:44','Parul Ghosh','aec.parul@gmail.com','http://net-affiliate-programs.blogspot.com/',1,'117.201.96.98'),(2712,206,'I like webhostingpad. I have been a subscriber of webhostingpad for last 2 years. They are a very good and reliable hosting service. They offer unlimited hosting space and bandwidth for a measely price. I can host unlimited websites on one account. Their customer service is great. They have a state of the art data center Webhostingpad offers 99.9% uptime gurantee. For new customers they offer a 30 day money back gurantee. Webhostingpad is simply great and far better than other webhosting services.','2009-01-18 00:18:44','kool121','surajitc1@gmail.com','',1,'117.99.43.29'),(2713,200,'I had a bad experience with Host Gator. I also had billing issues with them to the tune of a 30$ hosting charge that I didn\'t make! When I called to ask customer service what the deal was, they were extremely rude to me. \r\n\r\nBesides the previous mess, Host Gator was relatively good. It had great features and amazing uptime. There were a few bugs here and there. An occasional server would go down once in a while, but even Myspace has problems. Overall, it wasn\'t too bad, but I\'ll probably never use them again.','2009-01-18 00:18:44','Sarah','xombicide@hellokitty.com','',1,'67.163.174.101'),(2714,200,'I\'ve used Hostgator in the past. They\'ve always had wonderful tech support. When I had any problems, they were quick to resolve them and follow up with an email. In addition to the online chat support, they have toll-free support too, which comes in handy if you want to actually talk to a person.\r\n\r\nThey were constantly updating versions of software and features available, which made it easy to get the latest server-hosted applications to run. Over all, I was extremely pleased with their service.','2009-01-18 00:18:44','Bowers','beecher.bowers@gmail.com','http://beecherbowers.com/',-1,'204.111.115.165'),(2715,198,'I\'ve been using GoDaddy for the last 2 years for a number of websites including two blogs of mine. I have to say I am very disapointed with their level of support, several of my messages went unanswered for a number of days. The uptime has also been a consistient problem with many \'Service Unavailable messages\'. From what I\'ve gathered from several specialised hosting boards, GoDaddy have a tendency to oversell their hosting plans and most people end up sharing a server with thousand of people. Avoid if you can, especially if you have a popular website!','2009-01-18 00:18:44','Billy','jaygmk@gmail.com','',-1,'137.205.70.88'),(2716,197,'I used Yahoo a few years ago soon after they had bought Geocities. Back then I wasn\'t particularly knowledgeable on tech issues and I found their sitebuilder module and documentation very helpful. The uptime was generally very good and the support service was very helpful, with responses usually within a few hours. I would highly recommend them for people who are looking for a safe choice and good value hosting plans.','2009-01-18 00:18:44','Billy','jaygmk@gmail.com','',1,'137.205.70.88'),(2717,197,'i have used yahoo as a host a couple of times. its nice 4 those who love simplicity their site builder is very user friendly and basic.And of course its options are bit limited for advanced users. And though sometimes their server is down n u may face several in conveniences but their support system is real active and helps u out in every possible way..though its bit expensive than other hosting sites but u get real satisfaction of using the yahoo brandname..  ','2009-01-18 00:18:44','amresh mohapatra','amresh.mohapatra@gmail.com','',-1,'117.197.245.18'),(2718,1,'I would agree with many of the reviews posted here that Bluehost provides very good hosting plans that come with all features required for starting a website.  The features are particularly strong for a new user - cPanel, multiple database support, FTP, email and many more. The feature I like and use the most is simple scripts which makes it amazingly easy to install programs like Joomla, Wordpress, Drupal and about 20 other programs.  Not only that, but SimpleScripts handles updating these tools also.  I also like the File Manager - it gives you good access to all your files without having to know command line tools.\r\n\r\nThe support is good - both friendly and helpful. The killer piece is uptime and that\'s the reason I moved most of my sites elsewhere.  They have had several major outages from DNS attacks and when that happens all support can say is \"sometime soon your site will be live.\"  So if uptime matters - Bluehost is not the place to be (as I found out).','2009-01-18 00:18:44','David Silversmith','online@davidsilversmith.com','',1,'96.255.23.120'),(2719,200,'I have used Host Gator for several web sites over the years and also recommended tham to several clients who have needed \"smaller\" hosting options. I have had no hosting issues with them and the downtime over the years has been as good as any other company I have tried. There were a few billing issues over the years, but all were handled with just a phone call.\r\n\r\nOverall, I would recommend their services for most smaller to mid-sized web needs.','2009-01-18 00:18:44','Tom L','tomwl@yahoo.com','',1,'67.174.169.126'),(2721,206,'After reviewing Bluehost, I feel I should review the site that I left Bluehost for. After leaving Bluehost I chose Web Hosting Pad--for obvious reasons.\r\n\r\nFirst and foremost their price is great, 4.95/month is not bad at all. And their uptime is fantastic! They have a 99.9% uptime guarantee which is very hard to beat anywhere. The best part is, you can host unlimited websites on one account! And for their new customers they offer a 30 day moneyback guarantee. \r\n\r\nTheir support is much much better than Bluehost. Support usually takes 24 hours for response, and 24 hours to fix the issue, so 48 hours total. \r\n\r\nFeatures are basically the same as every other site. You will find them very user friendly and easy to navigate. \r\n\r\nOveraall, Web Hosting Pad is an extraordinary service for the price you pay. I would recommend this service to everyone who needs a host!  ','2009-01-19 22:22:42','Ben Baker','benbaker@iusb.edu','',1,'173.46.227.182'),(2722,202,'I worked with Lunarpages for a few months while I was doing a website for a friend of mine and I can say without any doubt, that is a great web host, I had no trouble during the setup and any question I had, was quickly answered by the web support, I never experienced any downtime during my time with them.\r\n\r\nCertainly it\'s one of the best values on web hosts since it\'s so easy to use and cheap too.','2009-01-19 22:22:42',' Wilsonx1999 ','secretuser81@gmail.com','',1,'189.154.47.106'),(2723,202,'Easy to set up, easy to work with, and very easy to talk to anyone who I needed to talk to with a problem that I had with a small website that I used for a while. The price may be a dollar or two more than some places, but they make up with how they work with you.\r\n\r\nWhile it may not have every single possible feature known to man, it\'s still a great site to work with.','2009-01-19 22:22:42','Josh A','joshthrowaway@gmail.com','',1,'70.178.211.152'),(2724,205,'I’ve used fatcow for over 5 months now and have had a very positive experience.  Despite having had a little trouble in the beginning, I guess I caught them at a bad time as my site was down a couple times, they are pretty consistent.   What I love about fatcow is that they offer affordable and reasonably priced hosting.  You’ll find that fatcow offers features that are pretty typical in hosting companies (i.e. high storage space, 1000+ email accounts including SMTP – POP3, shopping cart etc.).  Overall I am satisfied with the support given as they do offer an online help desk and customer support agents  you can call.','2009-01-19 22:22:42','Ivan','ivanwusurvey@gmail.com','',-1,'98.234.70.76'),(2725,199,'I am a customer of IPOWER hosting service. Their service is excellent. IPOWER offers incredible storage space with 300 GB storage and 3000 GB of data transfer per month. Ipower offers free website transfer and 30 day money back gurantee. They have interactive flash tutorials for newbie webmasters. Ipower offers many plug ins including guestbook, chat, bulletin board, poll or bloggers as well as Java and content plug-ins. Their customer service is good. They have comprehensive, responsive online and direct customer support. Ipower offers 100% uptime and my site never bogs down','2009-01-19 22:22:42','Suresh','c.surajit@yahoo.co.in','',-1,'117.99.30.35'),(2728,202,'This is the best host I\'ve used, it has the most reliable and trustworthy service. They have excellent uptime and outstanding transfer speeds which come into effect immediately. I pre-paid for one, full, year and when they changed the bandwidth and storage on their accounts they upgraded my account, best of all it was free of charge. I had a few problems and they were sorted quickly in the community forum where I got a fast response. I would recommend Lunarpages to anyone looking for web hosting, they are undoubtedly one of the best - if not the best!','2009-01-20 03:19:44','Aaron ','azycook@gmail.com','',1,'62.255.252.76'),(2727,202,'i think the best features because of which we should opt for lunarpages is its uptime and support i have experiences with other hosting companies,even some with big brand names but i have always faced the server down/shifting problems and the time taken to load the pages but after using lunarpages i have achieved great speeds and my users are really happy about that the price is not that expensive and you wouldn\'t regret paying it and whenever there is some problem they have an active support system to sort it out.. \r\n\r\n','2009-01-20 02:07:24','amresh','amresh.mohapatra@gmail.com','',1,'117.197.241.67'),(2729,192,'HostMonster is one of the most reliable web hosting I have ever worked upon. I have used few other web hostings too but I was not satisfied with their performances. Most of the time they will be down or slow. But incase of HostMonster, they are much more, reliable, uptime is always good, the service hardly goes down, unlimited bandwidth too and all these at a very good & catchy prize. It has some easily configurable options and a good GUI which suits even the newbies. All these at this rate is something simply superb.','2009-01-20 03:19:44','Nigen','nigen.h@gmail.com','',1,'59.92.15.44'),(2730,192,'I have been using HostMonster to host two of my websites for nearly a year now, and i have to praise their well planned hosting service. I previously had a very poor hosting service which literally made me tear my hair out as they were giving me pathetic service. But HostMonster has excellent Customer support and they provide support through their Live-Chat option even before we sign up for a hosting plan there. The price is affordable and very cheap compared to other hosts and its features, of course requires a contract to get down to earth prices which was fine by me since i was referred by a friend. I have never seen this host go down, so their guarantee of 99.9 percent uptime holds true. The control panel they use is pretty much the standard CPanel which has a variety of options. ','2009-01-20 03:19:44','Ananth','lambu_ananth@hotmail.com','http://www.ATechiesThoughts.com/',-1,'122.167.40.151'),(2731,205,'FatCow\'s price is the first thing that made it particularly attractive to me. Some of the other sites I saw with template HTML options were in the upwards of 14.00 or more a month, which these days especially seemed a little steep for my wallet.\r\n\r\nI wanted a professional looking site, designed with unique personal touches that made it specific to my needs. Fatcow not only offered this, but they did so in a financial bracket that is hard to scoff at. I have never experiennced any major down times or technical difficulties. The site was more than user freindly, and helpful when it came to selecting different tools that I might want to make available to potential customers perusing my site.\r\n\r\nIt helped with the tagging aspect as well. This generated great traffic I believe, and optimized search engine location. All in all I have been overly satusfied with my choice of fatcow. And would over and above reccomend it without hesitation to those seeking in expensive, yet highly effective professional web hosting!','2009-01-20 03:19:44','Joey','Tinkerbell82679@live.com','http://onceuponatour.com/',1,'64.12.116.7'),(2732,198,'I have used GoDaddy\'s hosting service for about one year and have been happy with their service for the most part.  We also use GoDaddy for our domain name registration.  If you plan to use their website tonight feature, be forewarned that it is not as easy as it looks and it certainly takes more than one night to get your website up and running!  Their customer support leaves a bit to be desired in terms of quickly solving problems.  I believe the price is reasonable and the end product is great, but the service and time it takes to get started on certain products could definitely be better.','2009-01-20 03:19:44','Phoebe','utfans5@bellsouth.net','',1,'74.242.170.134'),(2733,202,'My husband and I have used Lunarpages for about one year and have been extremely happy with all aspects of their service.  They are reasonably priced and we have never had a problem with uptime.  We also have used their Build A Site feature and were happy with the results.  Overall, Lunarpages is truly one of the best and most reliable companies online today,and we highly recommend their web hosting service.','2009-01-20 03:19:44','Heidi','utfans5@bellsouth.net','',1,'74.242.170.134'),(2734,202,'We briefly used LunarPages as a web host until moving on to a much more robust host.  Although they are pretty cheap, the extra costs for Shell Access, and not running Apache 2.0+ natively were large draw backs.  We loved having Ruby on Rails, PHP, PYTHON and PERL support right “out of the box”.  Finding cheap hosting that has Ruby on Rails enabled is rather hard at times.  We were a little let down by the lack of IMAP support; however the multimedia support options for the basic hosting package made up for it.  We don’t utilize JSP or ASP so the lack of instant availability for those didn’t matter too much.  Although we no longer use LunarPages because we need something much more complex and robust, they are a perfect and cheap host for a personal website; especially if you won’t be doing a whole lot of programming and simply want to use it to host your family photos or whatever.','2009-01-20 03:19:44','Matthew','themeehan@gmail.com','',1,'24.247.231.170'),(2735,202,'So glad I switched to Lunarpages. It has been a dream hosting my site. I love the friendly customer service.I needed some basic windows web hosting and have been using Lunarpages for 5 years now. The quality staff and all the awesome features that their web hosting plan provides is unbelievable. I could not be happier with Lunarpages\' great service and great web hosting plans. So easy to use and an absolute pleasure working with a great company.','2009-01-20 03:19:44','gasdertum','tgeorge_arsenal@yahoo.com','',1,'86.126.243.5'),(2736,202,'I had originally used Lunarpages to host my website; they were outstanding in terms of value, and although they didn\'t have any particularly exciting features, you got more than you paid for. I never experienced any problems that I needed to contact support for, but based on reviews placed by other users I assume it would\'ve been a simple and easy resolution process. The only reason I don\'t use them any more is because I wanted flexibility with a VPS.','2009-01-20 03:19:44','Jonathan','jonathan@xevium.net','',1,'69.207.203.223'),(2737,192,'I\'m at Host for more than 6 month now. I like the integrated features such as the choice in automated script installation and the Cpanel integrated interface. \r\nHowever, i had some problem during a server migration, where my DNS settings where lost and I needed to talk at least 5 times to the online support desk. The FTP upload is also kind of slow (150 kB/s max)\r\n\r\nGlobally, I would say it offers good services given its price and the offered features.','2009-01-20 03:19:44','Paul','paulheroin@mac.com','',1,'98.242.71.134'),(2738,206,'I ordered a hosting package from Webhosting Pad and prepaid for two years. After constant downtime with Webhosting Pad, and hardly ever my website up, I canceled my account with Webhosting Pad. After Webhosting Pad refused any refund, they instead sent a barrage of nasty emails, threatening legal action. Since our company relies on hosting services to provide our clients with websites, we have suffered damage of reputation and other costs associated with this dealing with Webhosting Pad.\r\n','2009-01-20 03:19:44','erik','erik_wu@live.com','',1,'71.77.62.146'),(2739,192,'i am currently using hostmonster web hosting service and overall it is good..the uptime is always good and it hardly gets down.the bandwidth is good.i am happy with the customer service that they provided. When i had questions,or needed to make changes,i always had excellent customer service.they have low competitive rates for hosting a domain site on their servers. Their interface seems lttle difficult to use.but,once u get used to it,it will not be a problem.i am fully satisfied with the hosting and like to recommand this to others.','2009-01-20 03:19:44','sabaedge','sabaedge@gmail.com','',-1,'117.201.16.11'),(2740,203,'I used StartLogic a while back. I had to pay for the entire year upfront, but that was the only bad part. I  don\'t do a lot of editing to my website - it is just for fun. The only time I had to contact them was to change the nameservers when I first set up my account so it would point to the right location. They were fairly helpful even though I am not very smart when it comes to internet things. The MIS department at my work explained some of the technical aspects as well.','2009-01-20 03:19:44','Marz Waggener','topsecretgal80@hotmail.com','http://www.bandaidqueen.com/',-1,'70.141.212.164'),(2741,192,'I joined HostMonster mainly because they are owned by BlueHost and I have had previous experience with them. I am currently using the service to host about 5 of my sites and I haven\'t had too many bumps in the road. I have had a few slow days over the year since I\'ve gotten the hosting with them. On those days their usually slow because their updating something. It is kind of annoying because I run ppc campaigns, but it happens rarely and I like their pricing so I put up with it. All in all I\'d have to say the hosting is pretty good for the price. I have no real complaints and am decently satisfied with this hosting service.','2009-01-20 03:19:44','Lindsey','missfunkadilly@gmail.com','',1,'76.20.119.190'),(2742,203,'StartLogic was perfect for me. The features that were offered to be were very convenient and easy to use. The support team was always there to help me and makes things easier. I am not that great with the internet, but they made it very easy to understand. Thank you :) The UP time was great, I never had a problem with that. Overall, I would rate StartLogic very high on the list. I was very pleased with the service that I received and would recommend it to others.','2009-01-20 03:19:44','Diana P','pressleybak@alltel.net','',1,'75.117.84.228'),(2743,202,'I was in the market for a additional hosting service so I wouldn\'t have \"all my eggs in one basket\" should my primary host go down. Based on some research, Lunarpages seemed like the answer. Hosting is priced comparably to other name hosts. The feature cPanel and Fantastico plus a great deal of the cPanel bells and whistles. I\'m going close to a year on LP with no downtime problems.\r\n\r\nNot that it\'s all to my liking. For instance, I don\'t think the support forum is all that active or useful. Same with the knowledge base. But, I was able to get support from the hosts themselves via a ticket. \r\n\r\nThe one thing I was pleasantly surprised to discover is that Lunarpages is proactive in testing their servers for script trouble. They\'ve sent out system wide emails to site owners. The info from the LP scan can then be used to fix the trouble. Pretty helpful!\r\n\r\nSo, bottom line, I\'d gladly recommend Lunarpages if you need to run a good sized site with special scripting and databases. Even if you have a smaller site, a hosting package would give you lots of room to grow and the peace of mind of letting experts handle your hosting.','2009-01-20 03:19:44','Lois Keaner','loiskeaner@yahoo.com','http://www.trendebooks.com/',1,'71.108.20.104'),(2744,198,'The best advice you can receive from a truthful friend is that if you need a web hosting company and you have a very popular website, don\'t even think about GoDaddy, GoPapa or whatever that goes. Because you will sure be dissapointed.\r\n\r\nThe truth should be said no matter who it hurts. Web hosts should always meet up with whatever they claim. So that they dont just waste people\'s valuable time and money and theirs too.\r\n\r\nGoDaddy should really work on their customer support, Uptime. Features are cool but should be a little more efficient.\r\n\r\nThis is the bitter truth.','2009-01-20 03:19:44','pas','pasignature@yahoo.com','',-1,'62.173.34.44'),(2745,199,'I have a friend who used Ipower a couple of years back. He actually stopped using Ipower when he started his own web services. I was personally using a different host then and my friend wouldn\'t stop asking me over to switch to Ipower.\r\n\r\nWe had to take time out to compare the two hosts. When we were through, I actually discovered that my friend was actually right. \r\n\r\nIpower is excellent. This is the host to stick with especially if you have a big website. Here you can get all the web space you ever wanted.\r\n\r\nIpower is the bomb!','2009-01-20 03:19:44','pas','pasignature@yahoo.com','',1,'62.173.34.44'),(2746,201,'I am fairly new to the web, so this is the only hosts that I\'ve used so far; but from my experience they were not to bad. they have fairly cheap hosting prices. They also offer alot of disk space and bandwidth, which is actually amazing for their price of only about three dollars. One unique thing that their doing is that they offer free domain names for the bigger order you place with them. Customer support I would say is pretty fair, I only had 1 question in two months and it was answered. I would have to rap this review up by saying: despite the fact I\'ve only been on the internet for two months, with the incredibly low cost for their hosting and how much they give this is a pretty good, no great hosting site. Kind of like a diamond in the rough. ','2009-01-20 03:19:44','tchrisf23','tchrisf23@aol.com','',1,'75.89.20.78'),(2747,206,'I have used the HostingPad for one year now and am extremely satisfied with its service in terms of quick and detailed support and the response time. Also relatively it is cheaper at almost 5 USD/month rather than 6-7 USD per month charged by many hosting providers with similar features. The only reason its ratings are low right now are because it has been less used by members. Otherwise it is quite good in the middle-range category. Ofcourse I won’t recommend it as yet to corporate who are looking for more secure space and direct and individualized dealings.','2009-01-20 03:19:44','Vijay Sata','sv@jamnation.in','',1,'220.225.151.81'),(2748,192,'This is a pretty good hosting solution for those who know what they’re doing. I chose it because it has support for Python, which is a critical part of my job. Once everything was set up, I did have a few problems, but the tech support was friendly, and quickly helped resolve my issues. The only real issue I have with HostMonster is that the uptime is less then optimal; there have been a few days where I could do nothing. Besides that, there’s nothing else I can say negatively about it. I recommend it.','2009-01-20 03:19:44','Andrew ','ffac06@gmail.com','',-1,'72.12.72.89'),(2749,203,'Start Logic have been visible in the hosting industry for quite a few years, and their more diverse as they offer plans ranging from basic, Windows, virtual, to even dedicated web hosting. It features plans that are both designed for the  beginner as well as the experienced developer, also Start Logic currently uses the vDeck control panel.\r\nThere\'s a top rated general support staff and They refund 100% any of the unused hosting services if one shall wish to leave. \r\nStart Logic seems to be devoted to providing their customers World-Class hosting and e-business solutions at an affordable price. \r\n\r\n','2009-01-20 03:19:44','Greg T.','solowpoet@yahoo.com','',-1,'72.204.156.229'),(2750,202,'I switched to lunarpages from another major web host. (you\'ve probably seen their commercials.) While uptime was good at the other host, it was very hard to use and support was horrible. Lunarpages was very quick and easy to use and set up. Their customer service was great too. I was pleasantly surprised because of the low price. It is a fabulous service and i would recommend it to any of my friends. I\'m going to be moving another two sites over as well.\r\n\r\n','2009-01-20 03:19:44','RadicalxEdward','nodeninedesign@gmail.com','',1,'63.127.8.130'),(2751,202,'skldjflksdjflksdfsdf','2009-01-22 02:18:57','Boob','baklsjdf!@jlskdf.com','',-1,'12.217.117.143'),(2752,215,'I set up a shared hosting account with 1&1 after having downtime issues at Dreamhost. While Dreamhost offered much more storage for the money, my needs were modest and I just wanted something I didn\'t have to fight to keep up.\r\n\r\nIt took two days for 1&1 to activate my account and server in spite of being the beginning of the week, so I have to ding them on support a little. Once up, however, it was smooth sailing from then on. My site felt much more responsive than it had on Dreamhost, and even under considerable load I never had any downtime at all.\r\n\r\nI\'d still be using them today except that my free time for running my site dried up and I decided to take it down.','2009-02-03 14:10:06','Michael','michael@tastyenglish.com','',1,'71.126.189.204'),(2753,215,'I\'ve first found 1and1 a few years ago and just used them as a domain host, but a year later decided to go with their webhosting. It\'s affordable and has some great features - however, the plan I started out with limited the size of the MySql databases.\r\n\r\nI didn\'t realize this when I first signed up so I had to call up and switch my plan. I think I called around 4am and someone was there to answer my questions. This was the only time I\'ve ever had to contact them. The host has great uptime, never caught my site down and it\'s fast compared to my old host.\r\n\r\nAll in all 1and1 was a good choice and I have been a happy customer since 2004 (If I can remember correctly). The only gripe I have is the lack of exchange e-mail accounts, but that\'s just me.','2009-02-03 14:10:06','Ross','ras188@gmail.com','',1,'66.240.10.170'),(2754,216,'Omnis has a very professional interface, and an easy to use vibe about it, that rivals none other. I used it for a while, and really liked the service I received. I only had one problem with my page, and they quickly and effectively solved my problem. Thanks for a great experience goes to Omnis!','2009-02-03 14:10:06','Jake Stover','stover.31@wright.edu','',1,'130.108.204.35'),(2755,215,'I\'ve used a few different hosting and domain registration services over the years, and now the only one I use - and the one I recommend to friends, family, and clients - is 1and1.  To me, they offer far and away the best value - low prices coupled with a host of goodies like free private domain registration and multiple email accounts.\r\n\r\nWhat sets 1and1 apart for me are two things.  First, their account dashboard - what you use to manage your own payments, add email accounts, and do more advanced things - is far and away the easiest to use and the most intelligently designed.  It\'s not perfect, but I spend no time locating the function I need and making the changes I want - no extra clicks, no bizarrely named menu options, everything is right where I think it should be.\r\n\r\nSecond, what they offer is listed right up front - no odd bundles (buy this to get this thing we\'re advertising at a lower price) no used car salesmen feel that overwhelms some web newbies.  Put another way, if my grandmother - or I - wanted X, Y, and Z for a website, I\'d feel like I knew what I was buying and for how much from 1and1... other sites I\'d feel worried I was missing something (and probably I was).\r\n\r\nThe only issue I\'ve run into with them is that their customer support can be uneven.  The few times I\'ve had to contact them with a question I always get the answer I need, but sometimes the response is at first confusing; other times it\'s nice, straightforward, and clear.  Similarly their FAQs are sometimes hard to navigate - but again, I have little need to use them.','2009-02-03 20:36:15','Aaron','owner@spunsimply.com','http://spunsimply.com/',1,'208.66.213.152'),(2756,193,'I went with HostRocket when I decided to change servers.  I have a game site, and I knew unlimited bandwith was absolutely necessary, because as my site grows, I\'ve had more and more bandwith issues.  I\'ve had a pretty good experience with HostRocket.  They provide the bandwith I need, a pretty nice amount of storage space, and absolutely GREAT support.  24/7 is really not an exaggeration, they really do try to help anytime.  But the big drawback: downtime.  A lot more than I\'d expected or hoped for.  It might not be that much in the grand scheme of things, but any downtime at all severely hurts my site and customers really get irate.  But, HostRocket does respond to every call and email quickly, so I appreciate that.','2009-02-03 20:36:15','J. E. Pickett','fthsiriusjade@yahoo.com','',1,'76.107.132.81'),(2757,215,'I have gone threw 7 web hosting companies, 1&1 sticks out so far above the pack. Their technical support is second to none, they are so fast in help you, you\'ll forget the problem you had to begin with. \r\n\r\nWith prices as low as 3.99/mo I recommend them to everyone. Having used the customer service line only twice, you get way more than you pay for. \r\n\r\nMoving into the backend management if you can\'t find the tool you need, no one makes it. Even for novice web guys you can manage a site with no hassle.','2009-02-03 20:36:15','Matt','badkarmainc@hotmail.com','',1,'70.180.244.223'),(2758,216,'Omnis is the ultimate webhosting service provider. Since 2006 i was using this service, they charge at nominal cost compare to other web hosting service provider. Cost for the web hosting service is $6.95/month only. Features of the Omnis web hosting service is good because, they update each and every feature to their customer and know their feedback, if we are willing to buy it their have a easy payment system. Coming to the customer service support, there are none other than best, they recifty and clear the problem what we have through phone (toll free number). I can say it is the best service provider for web hosting ','2009-02-03 21:58:43','vazrakar','vazrakar@gmail.com','',1,'121.246.92.118'),(2759,216,'Very easy to work with with a very nice control panel to do any changes you may have for your page. The customer service is fairly easy to work with, unless your problem is major, then it may take a bit of time o get things resolved. Overall however, this host is not a bad host to work with, and while more expensive than other sites, makes up for the service they can provide. Recommended for new and experienced web builders alike.','2009-02-03 21:58:43','aefnen','joshthrowaway@gmail.com','',1,'70.178.211.152'),(2760,201,'I started a personal blog around 4 months ago.  I decided that I wanted to host it personally, instead of using sites like blogspot.  They just feel wrong.  Besides, having a website of your own has many advantages.  Anyway, I looked at a few of the companies and I decided that I didn\'t want to go with a big name company, I was afraid that they would stab me in the back somehow.  So I dug and dug til I found this little site.  \r\n\r\nSo far it has been cheap and easy to use.  Not too many features, but the ones that they will offer are quite useful and helpful.  I haven\'t had too many questions in the past few months, but what I have asked has been readily answered.  They are alright.  I will have to close my site soon, due to a pay decrease.  But I will always keep this host in mind if I ever decide on going back into the blogosphere!','2009-02-03 21:58:43','Samuel Willis','samuelwillis@gmail.com','',1,'152.18.53.145'),(2761,219,'Pronet Hosting was launch by a group of professionals IT in 2001 to introduce a new standard in the fast growing environment of web hosting.\r\n\r\nThey offer many rich feature, on-demand reliable and secure web hosting services is why many customers stay at Pronet Hosting. They have very good service and constantly working to improve their range of services and the product line.\r\n\r\nThey have a good self educating support in flash format on their web hosting feature which is easy to follow. You will learn many tips, tricks and helpful information on how to administer your site.','2009-02-03 21:58:43','Ivonson','ikwee2008@yahoo.com','http://www.datehotgirls.net/',1,'202.188.96.20'),(2770,218,'I have been using HostDime for last 2 months and have realized the d