port is great. HostDime does not rely on third parties to help them. They do not resell to other data centers. I like the fact that you can physically access HostDime servers within seconds.  I don\'t know how many companies can do that.  HostDime is doing something right because they have about 500,000 Websites Worldwide.  With a loyal customer base that depends on their services.  What I also like about HostDime is that they back up their service with a genuine SLA located in their policy. HostDime does provide 24x7 support. They operate a manned data center 24 hours a day, 7 days a week. Which is good so people can talk to a live person, instead of a recording.  A human voice will be there to help you.  HostDime does offer a 90-day money-back guarantee. Finally, I love the video on the website that gives a tour of the server & cabinets in the Orlando DimeNOC.  Cool!','2009-02-03 21:58:43','Darius','datjo@mchsi.com','',1,'173.20.112.19'),(2766,208,'I had Netfirms for the past 2 weeks, I must admit that I like them. I think they have developed a great hosting site. I had another one that I do not want to name at the time, but I have to be honest and say that Netfirms gives you more options and more unique styles. The prices are better in my opionion then most of the hosting sites that are available now. That is why they have over 1 million customers. Its not surprising to me that they have over that amount. It also has to do with customer service, which they provide and it is excellent to me.','2009-02-04 00:29:59','Kay Gee','eyezglabeau@yahoo.com','',1,'68.81.1.91'),(2767,207,'Apollo Hosting is there when I need them. They are available 24/7 even in national holidays. I am using their services still because it is really nice to know your hosting provider is available all day long and that\'s why I am still using their services. I have not noticed any downtime of my websites and I don’t have any major problems. When initially setting up my accounts, the employees h