em, their provide the service at cheaper price ','2009-02-04 01:53:39','vazrakar','vazrakar@gmail.com','',1,'121.246.92.118'),(2771,193,'I used HostRocket on couple of months ago and I like it very much. The features that were offered to be were very convenient , easy to use and technically advanced. The support team was always there to help me and makes things easier. The UP time was great and I never had a problem with that. To use this we don\'t have to be expert in internet just a little knowledge is enough and now am refer many of my friends to HostRocket.I think its worth a recommendation. Overall, I would rate HostRocket very high on the list of all web hosting options.\r\n\r\nThanks!!!','2009-02-04 01:53:39','Yogesh R','outlookconnect@gmail.com','',1,'203.129.200.115'),(2772,212,'Easy CGI web hosing is a very reliable hosting especially if we need Windows hosting. The server configuration is Windows 2000 when I hosted and I am not sure about the current configuration. I would always recommend Easy CGI web hosting for windows based hosting. Personally, I am not sure about Linux server hosting.  The average windows hosting  costs around $20 or more per month with a setup fees. Easy CGI is an exception to that, with Windows 2000 hosting accounts starting at $7.96 per month. The  company started its web hosting services from 1994 and still steadily going on. For Windows web hosting, Easy CGI is a wonderful choice.','2009-02-04 01:53:39','Jack damien','damien77in@gmail.com','',1,'125.16.229.211'),(2773,194,'JumpLaunch is an excellent web service hosting provider around the world as far my knowledge beause it has alot of customers all over the globe.\r\nJumpLaunch\'s web host service tools are easy-to-use\r\n\r\nIt has 24/7 customer service which helps us regarding the problems of the hosting service \r\n','2009-02-04 01:53:39','vazrakar','vazrakar@gmail.com','',1,'121.246.92.118'),(2774,218,'I have used HostDime web hosting two months before in my friends concern