ng service has had very little downtime, compared to many other hosting services I have tried out. This is great for me since I run my business online. JumpLaunch has customer support both on the phone and through live chat. This was a real help to me when I first started because I had a few questions pertaining to my account. I was helped quickly and my problems were resolved very fast. I was very impressed with JumpLaunch since there are a relatively new host, but they\'ve exceeded my expectations I am very happy with them.','2009-02-04 01:53:39','Lindsey','missfunkadilly@gmail.com','',1,'76.232.176.115'),(2783,217,'   JumpLaunch has all of the features one would expect in a web hosting service. What made JumpLaunch my favorite (and I\'ve dealt with more than one hosting service) was the ease of transferring from another service (which I did do when signing on with JumpLaunch). They aslo give you ad credits for Yahoo and Google ads- can\'t beat that.\r\n   I also like their e-commerce services. Poor e-commerce services were what led me to look for a new hosting service in the first place. \r\n   If you are dissatisfied with anything, JumpLaunch offers a 30-day money back guarantee, so you\'ve got nothing to lose by trying them!','2009-02-04 01:53:39','cindy reiff','cmreiff@gmail.com','',1,'71.226.245.47'),(2784,217,'Listen Guy’s JumpLunch is a web hosting site that is by far  the best value for your money. personal users and businesses  alike can attest to this. JumpLunch has one of ,if not the highest customer satisfaction rates around compared with many other hosting companies.\r\n  The Folks over at JL guarantees a server with 99.9% uptime …99% That is right up there with the best in the web hosting industry, and one of the lowest possible incidents of service interruption for their websites.\r\nLet’s start with the CPanel 11 the most popular and groundbreaking version of the top web hosting control panels , plus Users can also host as many domains as they choose within the same account.\r\nTheses Guys continuously receive the highest web hosting awards largely based upon the company’s genuine customer service and first-rate tech support, which is by the way on call 24-7, so if you’re serious about you’re Web Hosting…..JumpLunch is the choice to make.\r\n','2009-02-04 01:53:39','Elton Thomas','tizinlala@yahoo.com','',1,'70.171.125.236'),(2785,214,'Dot5 hosting was simple to setup, and maintaining my site was a breeze. The templates were a little bit limiting, but highly customizable if that makes sense! If ever I ever had any problems, tech support was there with the answers in a quick and easy to understand solution to my issue. Practically the best $4.95 I\'ve ever spent! The only reason I moved away from Dot5 was because I found a local web hosting company that is green. If Dot5 went green and supported charities I would move back in an instant. ','2009-02-04 01:53:39','Jason HItchcock','jasonhitch@gmail.com','',1,'66.41.224.246'),(2786,217,'I have had a good experience with JumpLaunch. The thing that makes the hosting excellent is the fact that I never really have to worry about downtime or possibly losing business. That is really what has been most important to me so far. If there are ever any issues, they are mostly on my end when I need some technical assistance for a mistake I made. This is when their customer service comes into play. There have already been a few times when I had to make a 2-3am call about a 404/403/405 error or whatever the case may be and they were very patient with me. I will continue to use JumpLaunch because they make technology easy!','2009-02-04 15:52:51','Robert (Bob) Quinton','arete8855@gmail.com','',1,'67.167.38.30'),(2787,202,'When I first started using Lunar Pages I was very happy with their hosting. The customer service was great. They helped me set up my page above and beyond what I expected.\r\nAs my contract got about halfway into the 12mos, I started getting solicited to upgrade my account to a dedicated server. I did not need this, as my traffic was not even close to requiring anything that substantial. \r\nAbout 8mos in I got an email stating that one of my scripts was being overused. I attempted to call them and they keep bankers hours now. They would close early and even be closed on the weekends. I did some investigation and could not find how it was being overused. So, I changed the name of the script and completely removed the old file. I still got emails stating that the old file that no longer existed was still being over used. When I asked them how i t could be overused if it was not even there, they could not answer me and skirted around the issue.\r\nThey eventually suspended my site without warning and refused to help me solve the problem. I put in several tickets for assistance and it would be 3 days before I would hear back from them.\r\nI will never use this company again, nor will I recommend it.','2009-02-04 16:11:13','Natasha Heimberg','nheimberg@bellsouth.net','',1,'68.209.112.216'),(2788,221,'I used web.com for the period six month for our company website but have terminated the contract in the end. The reason behind our decision was they behaved rather unprofessional. For example, they changed the supported php version without notifying us first which, as you can imagine, caused quite a lot of problems since we were using EZpublish CMS at the time. However,  even worse than that was the support service which was absolutely abysmal. Even though they have nice prices and good features, I wouldn’t recommend this particular hosting to everyone. It’s just not worth your time and your nerves.  \r\n','2009-02-04 16:11:13','kristijan','kokoshina@gmail.com','',1,'78.1.134.100'),(2789,222,'I very much like SuperGreen Hosting. After a bad experience with another company, I switched to SuperGreen and cannot say enough. Their customer service is great and they are more than willing to help where they can. Their user interface is also easy to use. I recommend this company to anyone wanting to run their own site. The cost of SuperGreen is comparable and well worth the cost. Thank you SuperGreen for such a good experience. It is even nice to think that they are helping the environment by using more efficient \"green\" servers from Dell. They are also planting trees to help the environment.','2009-02-04 16:11:13','Natasha Heimberg','nheimberg@bellsouth.net','',1,'68.209.112.216'),(2790,221,'I found that when I used this sight it was not a bad sight I had some difficulty making a website with their editor and ability to get the pages the way I wanted them.\r\n\r\nI found one thing lacking with this sight when I used it, was they had no checkout cart when you wanted to use the sight for a business.\r\n\r\nI found that their sight was solid in uptime, and the features that were there were good if you had the patience to work them and figure them out.\r\n\r\nI found their support pushy when I needed to cancel, they wanted to give me 6 months free, and I wanted to find something cheaper.\r\n\r\nThat was the other major downside, for what they offered I could find something for half the price  that suited my needs, I discontinued using them for a variety of reasons.\r\n\r\nOne huge plus if you want short term with no contract obligations this was a very good sight for that, but for my needs I needed cheap without being bound into a contract for 2 to 3 years at a time.\r\n','2009-02-04 16:11:13','Mari Muccioli','oneandonemakesix@gmail.com','',1,'69.251.4.123'),(2791,219,'I am quite pleased of the services provided by Pronethosting.net. I decide to host my website there because i thought the prices were very reasonable. The features are all as promised and very usefull practically. The only disadvantage is some often server breakdowns, that some say it is used to happen in any hosting provider... The support department is working properly, but however when it comes to those „breakdowns”, i don’t get many