INSERT INTO `catalog_host` VALUES (1,1,1,'BlueHost','bluehost','BlueHost has been providing hosting solutions to thousands of business and personal web sites since 1996. Our internet hosting package helps businesses and individuals get high-powered service at a fraction of the cost.','http://www.tkqlhce.com/click-3316503-10376736',0,0,'',1,'hosts/Picture_7.png',0),(208,1,1,'Netfirms','netfirms','You can rely on Netfirms to handle your most advanced hosting needs. We host more than 1 million websites, e-commerce stores and blogs, and serve more than a billion page views a month. Netfirms powers some of the busiest sites on the web. ','http://www.kqzyfj.com/click-2772805-1629830',0,0,'',1,'hosts/netfirms_logo_s2.gif',0),(192,1,1,'HostMonster','hostmonster','HostMonster has been providing hosting solutions to thousands of business and personal web sites since 1996. Our internet hosting package helps businesses and individuals get high-powered service at a fraction of the cost.','http://www.hostmonster.com/track/jasber/hc',0,0,'',1,'hosts/logo_hostmonster.gif',0),(193,1,1,'HostRocket','hostrocket','HostRocket offers reliable, affordable dedicated and shared web hosting for both professional and personal websites. We provide cheap, secure domain hosting packages ranging from very basic, shared hosting to high bandwidth and high storage dedicated hosting.','http://affiliatecenter.hostrocket.com//idevaffiliate.php?id=5148',0,0,'',1,'hosts/Picture_9.png',0),(194,1,1,'JustHost','justhost','Just Host are dedicated to providing their customers with the most reliable web hosting service possible.\r\nAffordable price plans, secure servers, first class 24/7 technical support and a wide range of features\r\nmake hosting your website with Just Host the obvious choice.','http://www.kqzyfj.com/click-3316503-10589817',0,0,'',1,'hosts/Picture_3.png',0),(196,1,1,'Host Papa','host-papa','At HostPapa, we consider every one of our customers to be a part of our family. That\'s why our motto is \"Let Papa take care of you\".\r\n\r\nWe understand that our customers\' web sites are important and that they need to be able to count on us to ensure that their service is not interrupted.\r\n\r\nWe have established a solid foundation to offer a hosting solution for small-to-medium sized businesses that is reliable, easy-to-use, and customer service-oriented, all for a low cost.','http://hostpapa.com/cgi-bin/affiliates/clickthru.cgi?id=Jasber',0,0,'',1,'hosts/hostpapa-logo.png',0),(197,1,1,'Yahoo!','yahoo','Yahoo! is committed to making your online business a success. To prove we offer the best web hosting plan, we are pleased to offer our 30-Day Satisfaction Guarantee!\r\nIf you\'re not completely happy with your service within 30 days of ordering Yahoo! Web Hosting, we\'ll refund your hosting fee.','http://www.anrdoezrs.net/click-3316503-10492621',0,0,'',1,'hosts/y3.gif',0),(198,1,1,'GoDaddy','godaddy','GoDaddy.com hosting plans are ideal for most individuals and small businesses. We\'re the affordable, reliable place to host your site, offering features like a 99.9% network uptime commitment and 24/7 support.','http://www.tkqlhce.com/click-3316503-10378494',0,0,'',1,'hosts/logo_godaddy.gif',0),(199,1,1,'IPOWER','ipower','IPOWER, Inc., founded in October 2001, provides web hosting and web services for small- and medium-sized businesses worldwide looking to build, manage, promote and profit from an online presence. The company, which offers domain registration, web site hosting, e-commerce tools, merchant services, application hosting, online marketing, site optimization services, and web site design, is also famous for the speed and effectiveness of its customer support.','http://www.jdoqocy.com/click-3316503-10398311',0,0,'',1,'hosts/Picture_6.png',0),(200,1,1,'Host Gator','host-gator','HostGator.com, LLC is a world leading provider of shared, reseller, and dedicated web hosting. Privately held and based in Houston, Texas, the company was founded in 2002 by current President and CEO Brent Oxley, who started the company from his dorm room at Florida Atlantic University. Since then, HostGator has grown from a small hosting company with just three servers into a world leading and industry recognized hosting provider with more than 5,000 servers under management. The over one million domains hosted by HostGator make up approximately 1% of the world\'s Internet traffic.','http://www.dpbolvw.net/click-3316503-10410811',0,0,'',1,'hosts/10414006.gif',0),(201,1,1,'PowWeb','powweb','Since 1999, PowWeb has offered a low-cost, feature-rich Web hosting platform that appeals to a broad spectrum of users. Our all-inclusive “One Plan” takes the hassle out of finding the perfect hosting solution. Whether customers are small business owners or are running a state-of-the-art Web 2.0 application site, PowWeb provides the uptime and features they’ll need.','http://www.anrdoezrs.net/click-3316503-10394288',0,0,'',1,'hosts/10315183.gif',0),(202,1,1,'Lunarpages','lunarpages','There are thousands of web hosting services so why choose Lunarpages? When comparing web hosts it is important not only to consider a price difference of a dollar or two. Although we offer more data transfer and storage resources then you will likely ever utilize, we prefer to focus on something much more important, reliable web hosting and great customer service. Above all we take care of you personally and attentively with 24-7 award winning customer support. It\'s all about making sure your website and email remain online and you are happy. It\'s not just technical support to us; it\'s about caring for people since 1998. Phone us any time and become part of the rapidly growing Lunarpages web hosting family. We are rated #1 in the world. Call us now and find out why.\r\n','http://www.anrdoezrs.net/click-3316503-8242916',0,0,'',1,'hosts/Picture_12.png',0),(203,1,1,'StartLogic','startlogic','StartLogic is a leading provider of Web-hosting solutions and services for global business. Across the globe, businesses depend on StartLogic\'s easy-to-use, advanced and reliable load-balanced architecture, as well as responsive and knowledgable customer service to power their online presence.\r\n\r\nStartLogic offers a full line of solutions for personal, business, government and education customers.','http://www.anrdoezrs.net/click-3316503-10387606',0,0,'',1,'hosts/b_logo.gif',0),(204,1,1,'IX Web Hosting','ix-web-hosting','Reliability and support are major factors when considering a hosting provider. That’s why IX Web Hosting has just built a state-of-the-art Data Center, capable of storing up to 10,000 web servers! IX Web Hosting also provides a full team of round-the clock technicians and a separate Call Center also offering 24/7 customer support. IX offers three plans to fit all features and pricing needs.','http://www.kqzyfj.com/click-3316503-10394256',0,0,'',1,'hosts/header_logo.gif',0),(205,1,1,'FatCow','fatcow','FatCow was born in 1998 and the rest is history. We\'ve grown our company with a dedicated group of talented believers in the notion that simple, old fashioned service and value still ring true. FatCow has focused our entire company on delivering the best value and customer service experience in Web hosting to the small business user. We make every effort to make our services easy to own, easy to use and most importantly to provide real business value. And yes, we like to have fun doing it.','http://www.jdoqocy.com/click-3316503-10492159',0,0,'',1,'hosts/logo_fc_header.gif',0),(206,1,1,'Web Hosting Pad','web-hosting-pad','Webhostingpad.com was formed in 2005 with a team of very successful and proven industry veterans intent on delivering the best value in web hosting. With the growing need for affordable hosting, the company set out to deliver the best web hosting at a price where everyone can afford to have their piece of the world wide web. Webhostingpad.com remains committed to delivering the best value in Internet hosting by providing a safe, reliable and efficient process to create an Internet presence, all with a price structure driven by value.','http://www.kqzyfj.com/click-3316503-10555752',0,0,'',1,'hosts/Picture_8.png',0),(207,1,1,'Apollo Hosting','apollo-hosting','Our Total Solutions Hosting gives you all the tools you need to create a powerful presence on the Internet. Our commitment is to our customers. Offering products and services that no other hosting company is offering continues a tradition of Apollo Hosting paving the way in the Web Hosting industry.','http://www.kqzyfj.com/click-3316503-1508183',0,0,'',1,'hosts/10314473.gif',0),(212,1,1,'Easy CGI Web Hosting','easy-cgi-web-hosting','EasyCGI has custom developed an infinitely-expandable shared Web hosting platform, which allows for complete flexibility. This enhances our ability to offer new features and cutting edge technology upon availability. Our control panel allows our customers to administer every aspect of their account at any time, from any location. EasyCGI\'s three tiers of shared Web hosting solutions make the company\'s services suitable for a wide range of individuals and companies looking to host Web sites ranging from simple to complex.','http://www.tkqlhce.com/click-3316503-9111565',0,0,'',1,'hosts/252a3754easycgi_logo.gif',0),(213,1,1,'Aplus.net','aplusnet','With dozens of awards and decades of experience it’s easy to see why we’re the low cost web hosting provider that delivers and can help you take your online business to the next level. Our hosting plans are packed with everything you need to get started and tons of additional features. Whether you are starting your first site with our Personal Hosting Plan or building your business online with our Business Class, Professional, or eCommerce hosting plans, Aplus.net’s quality and reliable hosting plans can support your needs.','http://www.jdoqocy.com/click-3316503-10358727',0,0,'',1,'hosts/Aplus_net-logo.png',0),(214,1,1,'Dot5 Hosting','dot5-hosting','We provide our customers with quality Web hosting at an affordable price—and support them with friendly, high-quality technical support. Our call center provides technical support to our customers 24x7, and we pride ourselves on our quick-call response times, and our knowledgeable and courteous staff. We operate on the theory that if we don\'t look after our customers, someone else will.','http://www.jdoqocy.com/click-3316503-10362876',0,0,'',1,'hosts/dot5hosting.png',0),(215,1,1,'1 & 1','1-and-1','Choosing a reliable web host is important. 1&1 is both the world’s biggest web host, and the fastest growing. Our global community is 7.83 million customer contracts strong. We are financially stable, profitable, and will be securing your website for many years to come.','http://www.jdoqocy.com/click-3316503-10365666',0,0,'',1,'hosts/1and1.png',0),(216,1,1,'Omnis','omnis','Omnis Network, LLC is an Internet Hosting and Domain Name Registrar dedicated to achieving customer success. We have grown to become a leader in the Internet hosting industry by consistently delivering affordable, value added solutions. Being a Registrar facilitates the ease for an Omnis Network, LLC customer to both host a website and register a domain name, all from the same company.','http://www.kqzyfj.com/click-3316503-10383532',0,0,'',1,'hosts/Picture_13.png',0),(217,1,1,'JumpLaunch','jumplaunch','JumpLaunch is a principal web hosting provider supplying services and solutions for premium businesses worldwide. From all over the globe, intelligent businesses know who to turn to if they’re craving simply the best. JumpLaunch\'s easy-to-use, advanced and reliable load-balanced architecture, combined with our responsive and knowledgeable customer service, helps the company consistently rank at the top amongst all other providers.','http://www.anrdoezrs.net/click-3316503-10550897url=http%3A%2F%2Fwww.jumplaunch.com%2Fproducts%2F',0,0,'',1,'hosts/jumplaunch-hosting-logo.png',0),(218,1,1,'HostDime','hostdime','HostDime is a privately owned, leading website hosting provider offering managed hosting services that range of reliable, secure, entry-level to enterprise-level web hosting operations. Since its founding in late 2001, the fully supported managed server services and tools the company offers have empowered users to do more with cost in mind.','http://www.anrdoezrs.net/click-3316503-10553511',0,0,'',1,'hosts/hostdime.png',0),(219,1,1,'Pronethosting.net','pronethostingnet','Pronet Hosting was formed by a group of IT professionals in early 2001 to introduce a new standard in the fast changing environment of web hosting. Our mission is to achieve your 100% satisfaction, which is guaranteed by our professional service and friendly support.','http://www.dpbolvw.net/click-3316503-10604812?cm_mmc=CJ-_-1578344-_-3316503-_-Cheap%20Web%20Hosting',0,0,'',1,'hosts/pronet-hosting-logo1.gif',0),(220,1,1,'Jumpline','jumpline','At Jumpline, our mission is to deliver the best web hosting solutions, with the best customer service, on the best infrastructure in the hosting industry today. Through our years of experience, our attention to detail, and our established record of service, we stand strong in our mission and will continue to provide the most professional and reliable service possible to each and every one of our customers. From our knowledgeable support technicians to our systems engineers, everyone here at Jumpline realizes their roles and responsibilities and strives to provide an environment that will pave the way for the success of our web hosting customers.','http://www.anrdoezrs.net/click-2772805-1169316?url=http%3A%2F%2Fjumpline.com%2Fcompare_shared',0,0,'',1,'hosts/Picture_1____.png',0),(221,1,1,'Web.com','web-com','We don\'t want to date ourselves, but our SiteBuilder web publishing tool actually gave birth to the Do-It-Yourself website builder industry way back in 1997. Since then, millions of SiteBuilder websites have been published all over the world. For customers who want to create a website on their own, no other tool comes close to SiteBuilder\'s simplicity, flexibility and breadth of features. Call us zealots, if you like, but the truth is that SiteBuilder is simply the most powerful website builder software in the world.','http://www.dpbolvw.net/click-2772805-10524056?url=http%3A%2F%2Fwww.web.com%2FHosting%2FSiteBuilder.aspx',0,0,'',1,'hosts/webcom_logo.gif',0),(222,1,1,'SuperGreen','supergreen','Super Green gives you your own free domain name for life with our Hosting Plan! There\'s no need to panic about renewing your domain as Super Green will automatically do this for you to ensure you never lose the all important identity of your site.','http://www.tkqlhce.com/click-2772805-10569530',0,0,'',1,'hosts/Picture_2_.png',0);
