INSERT INTO `main_faq` VALUES (1,'How much space or bandwidth do I need?','The answer is probably not as much as you think. Most hosts these days offer unlimited bandwidth and space on small shared-hosting plans. Most sites fit into these categories which is why hosts are able to offer it at such a cheap price.',0),(2,'What\'s the catch with Unlimited bandwidth or space?','Hosts are able to offer unlimited plans because most sites barely use any bandwidth or space. They can also do this because they have strict Terms of Service (TOS) policies. These generally disallow file sharing, hosting, streaming or otherwise resource intensive services.',0),(3,'Which host is the best host for me?','There\'s no perfect host for everyone. That\'s why we offer a selection of the best. You can find hosts by their overall rating and then find out more by reading reviews and ratings. We suggest reading the customer reviews before selecting a host to find out what other customers have to say.',0),(4,'If I have experience with one of these hosts can I add a review?','Absolutely, and we hope you do. By sharing your experience you help others make better decisions. You can also help your host. A positive review sends their ranking up, which sends them more customers. But be careful, a negative review can have the opposite effect.',0),(5,'My host isn\'t listed. Can I add them?','Yes, if you want to submit your host and write the first review we\'d love to have them. Visit the <a href=\"/submit.html\">Submit A Host</a> page.',0),(7,'Are there affiliate links to the hosts?','The short answer is yes. If a host has an affiliate program we will use it. This helps us keep the site free of advertising and keeps the lights on. But our policy is very strict, <strong>we in no way use affiliate links to affect rankings</strong>. This is an area of trust, and our loyalty is to our customers. We will never manually adjust a hosts rank, <strong>ever</strong>.',0),(8,'How can you be unbiased while collecting affiliate money from hosts?','We\'re able to do this because affiliate links will never affect a hosts rank. Ranks are determined <strong>100%</strong> by the users. But you don\'t have to take our word for it, you can manually calculate each hosts rank and see for yourself. We\'re unbiased because we\'re transparent. We will never change this policy, you can count on that.',0),(9,'Do you ever edit reviews?','We never edit the review or ratings in any way. If a review is flagged for abuse or we feel it doesn\'t meet our quality guidelines, we will disable it. Also, we never manually rank reviews up. The rank of each review is determined by the community.',0),(10,'What are your quality guidelines?','At Hosting Choice we have standards that every review must meet to be kept on the site. Your review must be constructive. It can be negative or positive--but it must have weight behind it. Here are some examples:\r\n\r\n***Bad:*** \"I really like hosting company ABC, two thumbs up!\"\r\n\r\n***Good:*** \"I really like hosting company ABC because they care about their customers. I e-mailed them at 2am and they replied within 15 minutes. They\'re amazing, two thumbs up!\"\r\n\r\n***Bad:*** \"XYZ Host is terrible. Don\'t use them!\"\r\n\r\n***Good:*** \"XZY Host is terrible. They were down for 5 hours last week. When I tried to contact them they didn\'t reply until the next day. Stay far away from this host!\r\n',0),(11,'Why are all the prices for yearly contracts?','Unfortunately many hosts these days require 1 year contracts for all of their clients. For consistency\'s sake we\'ve listed all hosts using their 1 year contract price. Some hosts advertise their 2 or 3 year price while some advertise their month to month price. We decided 1 year was a good fit and it allows for a fair comparison across every host.',0);
