INSERT INTO `main_page` VALUES (1,'About Us','about','<p>Hosting Choice helps you find a quality host at a good price. There are too many hosts to choose from. Let Hosting Choice help. We\'ll sort through the confusion and recommend our favorite picks.</p>\r\n\r\n<p>We formed Hosting Choice to help you decide. We stripped down everything to the bare-essentials, giving you the necessary information to make the best decision.</p>\r\n\r\n<p>We also let our users decide which hosts get the spotlight. These are users that have actually used these hosts in the past. This is to keep us honest. Hosting Choice <a href=\"http://hosting-choice.com/faq.html#faq7\">promises to be unbiased</a>.</p>\r\n\r\n<p>To contact the owner of this site email: <img src=\"/media/images/email.png\" /></p>'),(2,'Submit A Host','submit','<p>Are you a web host that wants to be included in Hosting Choice?</p>\r\n\r\n<p>We just have 1 rule, <strong>no bad hosts</strong>.</p>\r\n\r\n<p>Hosting Choice will accept any good host into our directory. If your users don\'t like your hosting service, you need not apply. This is because we require a link back to each host that wants to be included in our directory. This encourages your users to share their experiences with us.</p>\r\n\r\n<p>If they\'re happy you\'ll float to the top of the site and receive many more sign-ups. But if you\'re a bad host, you\'ll sink to the bottom and we\'ll remove you from the site.</p>\r\n\r\n<p>So, if you\'re a <strong>good</strong> host, please send an e-mail to the following address: <img src=\"/media/images/email.png\" />.</p>'),(3,'Frequently Asked Questions (FAQ)','faq','<p>Below is a list of frequently asked questions about finding web hosting and Hosting Choice:</p>\r\n\r\n<ul class=\"normal\">\r\n<li><a href=\"#faq1\">How much space or bandwidth do I need?</a></li>\r\n<li><a href=\"#faq2\">What\'s the catch with Unlimited bandwidth or space?</a></li>\r\n<li><a href=\"#faq3\">Which host is the best host for me?</a></li>\r\n<li><a href=\"#faq4\">If I have experience with one of these hosts can I add a review?</a></li>\r\n<li><a href=\"#faq5\">My host isn\'t listed. Can I add them?</a></li>\r\n<li><a href=\"#faq6\">Are there affiliate links to the hosts?</a></li>\r\n<li><a href=\"#faq7\">How can you be unbiased while collecting affiliate money from hosts?</a></li>\r\n<li><a href=\"#faq8\">Do you ever edit reviews?</a></li>\r\n<li><a href=\"#faq9\">What are your quality guidelines?</a></li>\r\n<li><a href=\"#faq10\">Why are all the prices for yearly contracts?</a></li>\r\n</ul>\r\n\r\n<a name=\"faq1\"></a>\r\n<h2>How much space or bandwidth do I need?</h2>\r\n<p>The answer is probably not as much as you think. Most hosts these days offer unlimited bandwidth and space on small shared-hosting plans. Most sites fit into these categories which is why hosts are able to offer it at such a cheap price.</p>\r\n\r\n<a name=\"faq2\"></a>\r\n<h2>What\'s the catch with Unlimited bandwidth or space?</h2>\r\n<p>Hosts are able to offer unlimited plans because most sites barely use any bandwidth or space. They can also do this because they have strict Terms of Service (TOS) policies. These generally disallow file sharing, hosting, streaming or otherwise resource intensive services.</p>\r\n\r\n<a name=\"faq3\"></a>\r\n<h2>Which host is the best host for me?</h2>\r\n<p>There\'s no perfect host for everyone. That\'s why we offer a selection of the best. You can find hosts by their overall rating and then find out more by reading reviews and ratings. We suggest reading the customer reviews before selecting a host to find out what other customers have to say.</p>\r\n\r\n<a name=\"faq4\"></a>\r\n<h2>If I have experience with one of these hosts can I add a review?</h2>\r\n<p>Absolutely, and we hope you do. By sharing your experience you help others make better decisions. You can also help your host. A positive review sends their ranking up, which sends them more customers. But be careful, a negative review can have the opposite effect.</p>\r\n\r\n<a name=\"faq5\"></a>\r\n<h2>My host isn\'t listed. Can I add them?</h2>\r\n<p>Yes, if you want to submit your host and write the first review we\'d love to have them. Visit the <a href=\"/submit.html\">Submit A Host</a> page.</p>\r\n\r\n<a name=\"faq6\"></a>\r\n<h2>Are there affiliate links to the hosts?</h2>\r\n<p>The short answer is yes. If a host has an affiliate program we will use it. This helps us keep the site free of advertising and keeps the lights on. But our policy is very strict, <strong>we in no way use affiliate links to affect rankings</strong>. This is an area of trust, and our loyalty is to our customers. We will never manually adjust a hosts rank, <strong>ever</strong>.</p>\r\n\r\n<a name=\"faq7\"></a>\r\n<h2>How can you be unbiased while collecting affiliate money from hosts?</h2>\r\n<p>We\'re able to do this because affiliate links will never affect a hosts rank. Ranks are determined <strong>100%</strong> by the users. But you don\'t have to take our word for it, you can manually calculate each hosts rank and see for yourself. We\'re unbiased because we\'re transparent. We will never change this policy, you can count on that.</p>\r\n\r\n<a name=\"faq8\"></a>\r\n<h2>Do you ever edit reviews?</h2>\r\n<p>We never edit the review or ratings in any way. If a review is flagged for abuse or we feel it doesn\'t meet our quality guidelines, we will disable it. Also, we never manually rank reviews up. The rank of each review is determined by the community.</p>\r\n\r\n<a name=\"faq9\"></a>\r\n<h2>What are your quality guidelines?</h2>\r\n<p>At Hosting Choice we have standards that every review must meet to be kept on the site. Your review must be constructive. It can be negative or positive--but it must have weight behind it. Here are some examples:</p>\r\n<p><strong>Bad:</strong> \"I really like hosting company ABC, two thumbs up!\"</p>\r\n\r\n<p><strong>Good:</strong> \"I really like hosting company ABC because they care about their customers. I e-mailed them at 2am and they replied within 15 minutes. They\'re amazing, two thumbs up!\"</p>\r\n\r\n<p><strong>Bad:</strong> \"XYZ Host is terrible. Don\'t use them!\"</p>\r\n\r\n<p><strong>Good:</strong> \"XZY Host is terrible. They were down for 5 hours last week. When I tried to contact them they didn\'t reply until the next day. Stay far away from this host!</p>\r\n\r\n<a name=\"faq10\"></a>\r\n<h2>Why are all the prices for yearly contracts?</h2>\r\n<p>Unfortunately many hosts these days require 1 year contracts for all of their clients. For consistency\'s sake we\'ve listed all hosts using their 1 year contract price. Some hosts advertise their 2 or 3 year price while some advertise their month to month price. We decided 1 year was a good fit and it allows for a fair comparison across every host.</p>\r\n\r\n'),(4,'Terms of Service','terms','<strong>1. Terms</strong>\r\n<p>By accessing this web site, you are agreeing to be bound by these web site\r\nTerms and Conditions of Use, all applicable laws and regulations, and agree that\r\nyou are responsible for compliance with any applicable local laws. If you do not\r\nagree with any of these terms, you are prohibited from using or accessing this\r\nsite. The materials contained in this web site are protected by applicable\r\ncopyright and trade mark law.</p>\r\n\r\n<strong>2. Use License</strong>\r\n<p>Permission is granted to temporarily download one copy of the materials\r\n(information or software) on Hosting Choice\'s web site for personal,\r\nnon-commercial transitory viewing only. This is the grant of a license, not a\r\ntransfer of title, and under this license you may not: modify or copy the materials;\r\nuse the materials for any commercial purpose, or for any public display (commercial or non-commercial);\r\nattempt to decompile or reverse engineer any software contained on Hosting Choice\'s web site;\r\nremove any copyright or other proprietary notations from the materials; or\r\ntransfer the materials to another person or \"mirror\" the materials on any other server.\r\nThis license shall automatically terminate if you violate any of these\r\nrestrictions and may be terminated by Hosting Choice at any time. Upon\r\nterminating your viewing of these materials or upon the termination of this\r\nlicense, you must destroy any downloaded materials in your possession whether in\r\n    electronic or printed format.</p\r\n\r\n<strong>3. Disclaimer</strong>\r\n<p>The materials on Hosting Choice\'s web site are provided \"as is\". Hosting\r\nChoice makes no warranties, expressed or implied, and hereby disclaims and\r\nnegates all other warranties, including without limitation, implied warranties\r\nor conditions of merchantability, fitness for a particular purpose, or\r\nnon-infringement of intellectual property or other violation of rights. Further,\r\nHosting Choice does not warrant or make any representations concerning the\r\naccuracy, likely results, or reliability of the use of the materials on its\r\nInternet web site or otherwise relating to such materials or on any sites linked\r\nto this site.</p>\r\n\r\n<strong>4. Limitations</strong>\r\n<p>In no event shall Hosting Choice or its suppliers be liable for any damages\r\n(including, without limitation, damages for loss of data or profit, or due to\r\nbusiness interruption,) arising out of the use or inability to use the materials\r\non Hosting Choice\'s Internet site, even if Hosting Choice or a Hosting Choice\r\nauthorized representative has been notified orally or in writing of the\r\npossibility of such damage. Because some jurisdictions do not allow limitations\r\non implied warranties, or limitations of liability for consequential or\r\nincidental damages, these limitations may not apply to you.</p>\r\n\r\n<strong>5. Revisions and Errata</strong>\r\n<p>The materials appearing on Hosting Choice\'s web site could include technical,\r\ntypographical, or photographic errors. Hosting Choice does not warrant that any\r\nof the materials on its web site are accurate, complete, or current. Hosting\r\nChoice may make changes to the materials contained on its web site at any time\r\nwithout notice. Hosting Choice does not, however, make any commitment to update\r\nthe materials.</p>\r\n\r\n<strong>6. Links</strong>\r\n<p>Hosting Choice has not reviewed all of the sites linked to its Internet web\r\nsite and is not responsible for the contents of any such linked site. The\r\ninclusion of any link does not imply endorsement by Hosting Choice of the site.\r\nUse of any such linked web site is at the user\'s own risk.</p>\r\n\r\n<strong>7. Site Terms of Use Modifications</strong>\r\n<p>Hosting Choice may revise these terms of use for its web site at any time\r\nwithout notice. By using this web site you are agreeing to be bound by the then\r\ncurrent version of these Terms and Conditions of Use.</p>\r\n\r\n<strong>8. Governing Law</strong>\r\n<p>Any claim relating to Hosting Choice\'s web site shall be governed by the laws\r\nof the State of Iowa without regard to its conflict of law provisions.</p>\r\n\r\n<p>General Terms and Conditions applicable to Use of a Web Site.</p>\r\n\r\n'),(5,'Privacy Policy','privacy','<p>Your privacy is very important to us. Accordingly, we have developed this\r\nPolicy in order for you to understand how we collect, use, communicate and\r\ndisclose and make use of personal information. The following outlines our\r\nprivacy policy.</p>\r\n<p>Before or at the time of collecting personal information, we will identify\r\nthe purposes for which information is being collected.</p>\r\n<p>We will collect and use of personal information solely with the objective of\r\nfulfilling those purposes specified by us and for other compatible purposes,\r\nunless we obtain the consent of the individual concerned or as required by\r\nlaw.</p>\r\n<p>We will only retain personal information as long as necessary for the\r\nfulfillment of those purposes.</p>\r\n<p>We will collect personal information by lawful and fair means and, where\r\nappropriate, with the knowledge or consent of the individual concerned.</p>\r\n<p>Personal data should be relevant to the purposes for which it is to be used,\r\nand, to the extent necessary for those purposes, should be accurate, complete,\r\nand up-to-date.</p>\r\n<p>We will protect personal information by reasonable security safeguards\r\nagainst loss or theft, as well as unauthorized access, disclosure, copying, use\r\nor modification.</p>\r\n<p>We will make readily available to customers information about our policies\r\nand practices relating to the management of personal information.</p>\r\n<p>We are committed to conducting our business in accordance with these\r\nprinciples in order to ensure that the confidentiality of personal information\r\nis protected and maintained.</p>\r\n\r\n'),(7,'News','news','## Hosting Choice Launches! ##\r\n\r\n**HOSTING CHOICE LAUNCHES AS WEB HOSTING REVIEW SITE FOR THE PEOPLE**\r\n\r\n(DAVENPORT, IA. - January 14, 2008). Hosting Choice launched today as a preimiere web hosting directory by Brad Jasper. Its different from other web hosting review sites, it lets its users decide which hosts are ranked best.\r\n\r\nOther web hosting review sites often accept money from hosts to be ranked higher. Not Hosting Choice. Their users have full control over where each host is ranked based on the reviews and ratings they leave.\r\n\r\nBrad Jasper, the owner remarks, \"I hope Hosting Choice is a breathe of fresh air in to the corrupted hosting review market.\" The market is heavily saturated, but Hosting Choice aims to be the white knight by offering consumers what they\'ve always wanted: an unbiased hosting review site.\r\n\r\nFor additional information visit their Web site at http://hosting-choice.com. \r\n\r\n'),(8,'Directories','directories','* http://www.littlewebdirectory.com/links.asp\r\n* http://www.webhostingsearch.com\r\n* http://